  const [list, setList] = useState([
    {text: "Learn about React"},
    {text: "Meet Friend"},
    {text: "Complete navbar for Project"},
  ])

  return (
    <div className="app">
      <div className="todo-list">
        {list.map((todo, index) => (
          <Todo key={index}
          index={index}
          todo={todo} />
        ))}
      </div>
    </div>
  );
}
